export class Transaction {
    id: number;
    userId: number;
    amount: number;
    type: 'add' | 'deduct';
    timestamp: Date;

    constructor(id: number, userId: number, amount: number, type: 'add' | 'deduct', timestamp: Date){
        this.id = id;
        this.userId = userId;
        this.amount = amount;
        this.type = type;
        this.timestamp = timestamp;
    }

  }
